import React from "react";
import Product from "../Product/Product";

const ProductList = (props) => {  
  return (
    <div>
      {props.product.map((item, index) => (
        <Product
          key={index}
          title={item.title}
          price={item.price}
          click={() => props.click(index)}
          change={(event) => props.change(event, item.id)}
        />
      ))}
    </div>
  );
};

export default ProductList;
